import React from 'react';
import '../../estilos/componentes/layout/header.css'

const Header = (props) => {
    return (
        <div>
            <header class="encabezado">
                <div class="holder">
                    <div class="elh1">
                        <h1>Pablo Iván Bárcena</h1>
                        <p>Curriculum Vitae</p>
                    </div>
                </div>
            </header>
            <div><img src="/public/imagenes/cv.jpg" alt="foto" class="foto"/></div>
        </div>
    );
}

export default Header;
